import React, { Component } from 'react';

class Cell extends Component {
  render() {
    return (
      <div>
        <div class="row0">
          <div id="0" onclick="changeColor(this)" class="square"></div>
          <div id="1" onclick="changeColor(this)" class="square"></div>
          <div id="2" onclick="changeColor(this)" class="square"></div>
        </div>
        <div class="row1">
          <div id="3" onclick="changeColor(this)" class="square"></div>
          <div id="4" onclick="changeColor(this)" class="square"></div>
          <div id="5" onclick="changeColor(this)" class="square"></div>
        </div>
        <div class="row2">
          <div id="6" onclick="changeColor(this)" class="square"></div>
          <div id="7" onclick="changeColor(this)" class="square"></div>
          <div id="8" onclick="changeColor(this)" class="square"></div>
        </div>
      </div>  
    )
  }
}

export default Cell;
